syntax = "proto3";
package com.jkys.phobos.remote.protocol.protobuf;
import "google/protobuf/any.proto";
message Response {
    bool success = 1;
    string err_code = 2;
    string err_message = 3;
    string application_error_type = 4;
    google.protobuf.Any data = 5;
}